import React from 'react';
import DoughnutChart from '../charts/DoughnutChart';
import { Row, Col, Card } from 'react-bootstrap';

const adminPanel = () => {
  return (
    <>
      <Row>
        <Col xs={12} md={6}>
          <Card className="card_main">
            <Card.Body className="card row d-flex justify-content-center text-center p-5 box-shadow">
              <DoughnutChart />
            </Card.Body>
          </Card>
        </Col>
        <Col xs={12} md={6}>
          <Card className="card_main">
            <Card.Body className="card row d-flex justify-content-center text-center p-5 box-shadow">
              <DoughnutChart />
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </>
  );
};

export default adminPanel;
